import React from "react";
import Header from "./Components/Header";
import Home from "./Components/Home";
import { Route, Switch } from "react-router-dom";

const App = () => {
  return (
    <>
      <Header />
      <main className="main">
        <Switch></Switch>
        <Route path="/">
          <Home />
        </Route>
      </main>
    </>
  );
};

export default App;
